  \"2015-12-20T18:53:16.539518\",\n\t\"name\": \"shoreline-of-molokai-derived-from-ikonos-and-quick-bird-satellite-imagery-2004-20061e76f\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This project is a cooperative effort between
  the National Ocean Service, National Centers for Coastal Ocean Science, Center for
  Coastal Monitoring and Assessment, the University of Hawaii, BAE Systems Spectral
  Solutions and Analytical Laboratories of Hawaii, LLC. The goal of the work was to
  map the coral reef habitats of the Main Eight Hawaiian Islands by visual interpretation
  and manual delineation of IKONOS and Quick Bird satellite imagery.A two tiered habitat
  classification system was tested and implemented in this work. It integrates geomorphologic
  reef structure and biological cover into a single scheme and subsets each into detail.
  It also includes fourteen zones. This shapefile was created from the shoreline digitized
  during this process.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
